.main-content {
 &__screen-container {
  display: none;
 }
 &__screen.project {
  width: 60vw;
  height: 76vh;

  position: absolute;
  top: 13vh;
  // background: antiquewhite;
  background: linear-gradient(332.03deg, rgb(98, 46, 46), rgb(149, 141, 141));
  //   left: 17vw;
  margin-left: 11vw;
  border-radius: 7px;
  // opacity: 0.96;
  //   border: 2px solid $activeTubeColor;
  // box-shadow: 0px 0px 11px #ff8888;
  filter: drop-shadow(0 -3px 1px #c67e7e) drop-shadow(0 2px 2px #c67e7e);
  @include flexCentered;
  // flex-wrap: wrap;
  // overflow-y: scroll;
 }

 &__screenproject-card__wrapper {
  @include flexCentered;
  width: 100%;
 }

 &__screenProject-card {
  width: 36vw;
  display: inline-block;
  height: 50vh;
  // border: $borderTest;
 }

 &__screenproject-header {
  font-family: 'Reenie Beanie', cursive;
  position: absolute;
  top: 4vh;
  right: 4vw;
  font-size: 3.5rem;
  color: #dedede;
 }

 &__screen.project#landingPage-screen,
 &__screen.project#newsletter-screen,
 &__screen.project#transactional-screen,
 &__screen.project#promo-screen,
 &__screen.project#contact {
  display: none;
 }

 @media screen and (max-width: 500px) {
  &__screen.project {
   display: flex;
   margin: 0 auto;
   left: 3vw;
   flex-wrap: nowrap;
   width: 94%;
   height: 70vh;
   border: 1px solid aliceblue;
   position: absolute;
   top: 17vh;
   background: linear-gradient(332.03deg, #622e2e, #958d8d);
   border-radius: 7px;
   border: 2px solid #eb8a91;
   filter: drop-shadow(0 -3px 2px #fa9898) drop-shadow(0 3px 2px #fa9898);
   overflow-x: scroll;
  }

  //root: rule for project Screen

  &__screen.project#landingPage-screen,
  &__screen.project#newsletter-screen,
  &__screen.project#transactional-screen,
  &__screen.project#promo-screen &__screen.project#contact {
   //    display: flex;
  }
  &__screen.project#contact {
   padding: 4em;
   text-align: center;
  }

  div.project-card__container.newsletter,
  div.project-card__container.transactional {
   left: -21vw;
  }

  &__screenproject-header {
   position: sticky;
   left: 46vw;
   right: 0;
   bottom: 13.4em;
   top: 0;
   flex-shrink: 0;

   &.transactional {
    left: 37vw;
   }
  }
  &__screenproject-card__wrapper {
   display: flex;
   margin-left: 21vw;
   margin-top: 6vh;
  }

  div.project-card__container {
   min-width: 62vw;
   width: 62vw;
  }
 }
}

.navigation-container {
 position: absolute;
 //   bottom: 4vh;
 //   left: 40vw;
 top: 50%;
 width: 100%;
}

.fa {
 color: whitesmoke;
 font-size: 3.4rem;
 background-color: rgb(33, 143, 143);
 //   background-color: #39a397;
 border-radius: 50%;
 padding: 0.2em;
 width: 1.4em;
 margin: 0 1em;
 display: none;
 cursor: pointer;
 &:hover {
  background-color: rgb(34, 90, 90);
 }
}
.fa.fa-angle-left {
 position: absolute;
 left: 0;
}

.fa.fa-angle-right {
 position: absolute;
 right: 0;
}

p.projectScreen__project-project__liveLink {
 font-size: 1.3rem;
 font-family: Arial, Helvetica, sans-serif;
 cursor: pointer;
 margin-bottom: 0.8em;
 position: relative;
 //  z-index: 1;
 > a {
  color: $liveLinkColor;
  cursor: pointer;
 }
}

div.landingPage {
 position: absolute;
 @include transition-ease;
}

// div.landingPage.slide4{
//     background : #201e1e;
//     width : 100%;
//     padding : 2em;
// }

.hidden {
 display: none;
}

.projectScreen__project {
 display: none;
}

.projectScreen__project-project#project-promo {
 display: none;
}

.projectScreen__project-project#project-transactional {
 display: none;
}

.projectScreen__project-project#project-newsletter {
 display: none;
}

.projectScreen__project-project#project-landingPage {
 display: none;
}
